INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<?php $site_name = variable_get(''site_name''); ?>\r\n\r\n<div class="container">\r\n     <div class="col-md-4 col-sm-4 footer-logo">\r\n           <p><?php echo $site_name; ?></p>\r\n     </div>\r\n     <div class="col-md-8 col-sm-8 footer-class">\r\n           <p>Copyright © 2018. SmartProp  | <a href="/disclaimer">Disclaimer</a> | <a href="/sitemap">Sitemap</a></p>\r\n     </div>\r\n</div>', 'Smart Prop Footer', 'php_code'),
(2, ' <?php\r\n  $query = new EntityFieldQuery();\r\n  $entities = $query->entityCondition(''entity_type'', ''node'')\r\n  ->propertyCondition(''type'', ''page'')\r\n  ->propertyCondition(''title'', ''About SmartProp'')  \r\n  ->propertyCondition(''status'', 1)\r\n  ->range(0,1)\r\n  ->execute();\r\n\r\n  if (!empty($entities[''node''])) {\r\n     foreach($entities[''node''] as $entities_key => $entities_value) {\r\n         $node = node_load($entities_value->nid);\r\n    }\r\n  }\r\n?>\r\n<div class="about-text"><p><?php echo $node->body[''und''][0][''value'']; ?></p></div>', 'About SmartProp', 'php_code'),
(4, '<div class="sell-property">\r\n <div class="banner-overlay">\r\n  <div class="container">\r\n        <div class="row">\r\n		\r\n            <div class="col-md-8 col-sm-8 col-xs-8 wow fadeInUp" data-wow-duration="1s" data-wow-delay="0s" style="visibility: visible; animation-duration: 1s; animation-delay: 0s; animation-name: fadeInUp;">\r\n                <div class="call-us">\r\n                    <h3>Do you want to know more</h3>\r\n                    <span>Click on ''know more''</span>\r\n                </div>\r\n            </div>\r\n			\r\n            <div class="col-md-4 col-sm-4 col-xs-4 sell-contact wow fadeInUp" data-wow-duration="1s" data-wow-delay="0s" style="visibility: visible; animation-duration: 1s; animation-delay: 0s; animation-name: fadeInUp;">\r\n                <a href="/about-us">Know More</a>\r\n            </div>\r\n			\r\n        </div>\r\n  </div>\r\n </div>\r\n</div>', 'Know More', 'full_html'),
(5, '<div class="sell-property"> \r\n <div class="banner-overlay">\r\n <div class="container">\r\n        <div class="row">\r\n		\r\n            <div class="col-md-8 col-sm-8 col-xs-8 wow fadeInUp" data-wow-duration="1s" data-wow-delay="0s" style="visibility: visible; animation-duration: 1s; animation-delay: 0s; animation-name: fadeInUp;">\r\n                <div class="call-us">\r\n                    <h3>Do you want to check more projects</h3>\r\n                    <span>Click on ''More Projects''</span>\r\n                </div>\r\n            </div>\r\n			\r\n            <div class="col-md-4 col-sm-4 col-xs-4 sell-contact wow fadeInUp" data-wow-duration="1s" data-wow-delay="0s" style="visibility: visible; animation-duration: 1s; animation-delay: 0s; animation-name: fadeInUp;">\r\n                <a href="/projects">More Projects</a>\r\n            </div>\r\n			\r\n        </div>\r\n  </div>\r\n </div>\r\n</div>', 'More Projects', 'full_html'),
(6, '<div class="contract-section" id="contact-agent">\r\n    <div class="container">\r\n        <div class="contract-border">\r\n            <div class="contract">\r\n                <div class="row">\r\n                    <div class="col-md-4 col-sm-12 contract-left wow fadeIn" data-wow-duration="1.2s" data-wow-delay="0s" style="visibility: visible; animation-duration: 1.2s; animation-delay: 0s; animation-name: fadeIn;">\r\n                        <h2>Contract Agent</h2>\r\n                              <?php $block19 = module_invoke(''webform'',''block_view'',''client-block-19''); \r\n                                  print render($block19[''content'']);\r\n                               ?>\r\n                    </div><!-- end .col-md-4 -->\r\n					\r\n                    <div class="col-md-4 col-sm-6 wow fadeIn" data-wow-duration="1.2s" data-wow-delay="0.4s" style="visibility: visible; animation-duration: 1.2s; animation-delay: 0.4s; animation-name: fadeIn;">\r\n                        <div class="contract-right">\r\n                            <h2>John Doe</h2>\r\n                            <h3>Senior Agent of ECOREAL</h3>\r\n                            <p>Lorem ipsum dolor sit amet,  dolor sit amet,  dolorsian adipiscing elit. Duis eu magna metus. Donec sed erat nonconsectetur adipiscing elit. Duis eu magna</p>\r\n                            <span>+0123-456-789 <i class="fa fa-phone"></i></span>\r\n                            <span>email@yourdomain.com <i class="fa fa-envelope"></i></span>\r\n                            <div class="contract-social header-social">\r\n                                <ul>\r\n                                    <li><a href="#"><i class="fa fa-facebook"></i></a></li>\r\n									<li><a href="#"><i class="fa fa-twitter"></i></a></li>\r\n									<li><a href="#"><i class="fa fa-linkedin"></i></a></li>\r\n									<li><a href="#"><i class="fa fa-google-plus"></i></a></li>\r\n                                </ul>\r\n                            </div><!-- end .contract-social -->\r\n                        </div>\r\n                    </div><!-- end .col-md-5 -->\r\n					\r\n                    <div class="col-md-4 contract-pic col-sm-6 wow fadeIn" data-wow-duration="1.2s" data-wow-delay="0.6s" style="visibility: visible; animation-duration: 1.2s; animation-delay: 0.6s; animation-name: fadeIn;">\r\n                        <img src="/sites/all/themes/smart/images/women-agent.png" alt="">\r\n                    </div><!-- end .col-md-4 -->  \r\n    \r\n                </div><!-- end .row -->\r\n            </div><!-- end .col-md-8 -->\r\n        </div><!-- end .row -->\r\n    </div><!-- end .container-fluid -->\r\n</div>', 'Contact Agent', 'php_code'),
(7, '<div class="sell-property"> \r\n <div class="banner-overlay">\r\n <div class="container">\r\n        <div class="row">\r\n		\r\n            <div class="col-md-8 col-sm-8 col-xs-8 wow fadeInUp" data-wow-duration="1s" data-wow-delay="0s" style="visibility: visible; animation-duration: 1s; animation-delay: 0s; animation-name: fadeInUp;">\r\n                <div class="call-us">\r\n                    <h3>Do you want to check more blogs</h3>\r\n                    <span>Click on ''More Blogs''</span>\r\n                </div>\r\n            </div>\r\n			\r\n            <div class="col-md-4 col-sm-4 col-xs-4 sell-contact wow fadeInUp" data-wow-duration="1s" data-wow-delay="0s" style="visibility: visible; animation-duration: 1s; animation-delay: 0s; animation-name: fadeInUp;">\r\n                <a href="/our-blog">More Blogs</a>\r\n            </div>\r\n			\r\n        </div>\r\n  </div>\r\n </div>\r\n</div>', 'More Blogs', 'full_html');
